(*Integrands of the form (a^2+2 a b x^2+b^2 x^4)^(p/4)*)


{(a^2 + 2*a*b*x^2 + b^2*x^4)^(3/4), x, 4, (1/4)*x*(a^2 + 2*a*b*x^2 + b^2*x^4)^(3/4) + (3*a*x*(a^2 + 2*a*b*x^2 + b^2*x^4)^(3/4))/(8*(a + b*x^2)) + (3*Sqrt[a]*(a^2 + 2*a*b*x^2 + b^2*x^4)^(3/4)*ArcSinh[(Sqrt[b]*x)/Sqrt[a]])/(8*Sqrt[b]*(1 + (b*x^2)/a)^(3/2))}
{(a^2 + 2*a*b*x^2 + b^2*x^4)^(1/4), x, 3, (1/2)*x*(a^2 + 2*a*b*x^2 + b^2*x^4)^(1/4) + (Sqrt[a]*(a^2 + 2*a*b*x^2 + b^2*x^4)^(1/4)*ArcSinh[(Sqrt[b]*x)/Sqrt[a]])/(2*Sqrt[b]*Sqrt[1 + (b*x^2)/a])}
{1/(a^2 + 2*a*b*x^2 + b^2*x^4)^(1/4), x, 2, (Sqrt[a]*Sqrt[1 + (b*x^2)/a]*ArcSinh[(Sqrt[b]*x)/Sqrt[a]])/(Sqrt[b]*(a^2 + 2*a*b*x^2 + b^2*x^4)^(1/4))}
{1/(a^2 + 2*a*b*x^2 + b^2*x^4)^(3/4), x, 2, (x*(a + b*x^2))/(a*(a^2 + 2*a*b*x^2 + b^2*x^4)^(3/4))}
{1/(a^2 + 2*a*b*x^2 + b^2*x^4)^(5/4), x, 3, (x*(a + b*x^2))/(3*a*(a^2 + 2*a*b*x^2 + b^2*x^4)^(5/4)) + (2*x)/(3*a^2*(a^2 + 2*a*b*x^2 + b^2*x^4)^(1/4)), (2*x)/(3*a^2*(a^2 + 2*a*b*x^2 + b^2*x^4)^(1/4)) + x/(3*a*(a + b*x^2)*(a^2 + 2*a*b*x^2 + b^2*x^4)^(1/4))}
{1/(a^2 + 2*a*b*x^2 + b^2*x^4)^(7/4), x, 4, (x*(a + b*x^2))/(5*a*(a^2 + 2*a*b*x^2 + b^2*x^4)^(7/4)) + (4*x)/(15*a^2*(a^2 + 2*a*b*x^2 + b^2*x^4)^(3/4)) + (8*x*(a + b*x^2))/(15*a^3*(a^2 + 2*a*b*x^2 + b^2*x^4)^(3/4)), (4*x)/(15*a^2*(a^2 + 2*a*b*x^2 + b^2*x^4)^(3/4)) + x/(5*a*(a + b*x^2)*(a^2 + 2*a*b*x^2 + b^2*x^4)^(3/4)) + (8*x*(a + b*x^2))/(15*a^3*(a^2 + 2*a*b*x^2 + b^2*x^4)^(3/4))}
{1/(a^2 + 2*a*b*x^2 + b^2*x^4)^(9/4), x, 5, (x*(a + b*x^2))/(7*a*(a^2 + 2*a*b*x^2 + b^2*x^4)^(9/4)) + (6*x)/(35*a^2*(a^2 + 2*a*b*x^2 + b^2*x^4)^(5/4)) + (8*x*(a + b*x^2))/(35*a^3*(a^2 + 2*a*b*x^2 + b^2*x^4)^(5/4)) + (16*x)/(35*a^4*(a^2 + 2*a*b*x^2 + b^2*x^4)^(1/4)), (16*x)/(35*a^4*(a^2 + 2*a*b*x^2 + b^2*x^4)^(1/4)) + x/(7*a*(a + b*x^2)^3*(a^2 + 2*a*b*x^2 + b^2*x^4)^(1/4)) + (6*x)/(35*a^2*(a + b*x^2)^2*(a^2 + 2*a*b*x^2 + b^2*x^4)^(1/4)) + (8*x)/(35*a^3*(a + b*x^2)*(a^2 + 2*a*b*x^2 + b^2*x^4)^(1/4))}


