(*Integrands of the form (a+b x^2+c x^4)^p*)


{1/(a^2 + b + 2*a*x^2 + x^4), x, 9, -(ArcTan[(Sqrt[-a + Sqrt[a^2 + b]] - Sqrt[2]*x)/Sqrt[a + Sqrt[a^2 + b]]]/(2*Sqrt[2]*Sqrt[a^2 + b]*Sqrt[a + Sqrt[a^2 + b]])) + ArcTan[(Sqrt[-a + Sqrt[a^2 + b]] + Sqrt[2]*x)/Sqrt[a + Sqrt[a^2 + b]]]/(2*Sqrt[2]*Sqrt[a^2 + b]*Sqrt[a + Sqrt[a^2 + b]]) - Log[Sqrt[a^2 + b] - Sqrt[2]*Sqrt[-a + Sqrt[a^2 + b]]*x + x^2]/(4*Sqrt[2]*Sqrt[a^2 + b]*Sqrt[-a + Sqrt[a^2 + b]]) + Log[Sqrt[a^2 + b] + Sqrt[2]*Sqrt[-a + Sqrt[a^2 + b]]*x + x^2]/(4*Sqrt[2]*Sqrt[a^2 + b]*Sqrt[-a + Sqrt[a^2 + b]])}
{1/(-1 + a^2 + 2*a*x^2 + x^4), x, 3, -(ArcTan[x/Sqrt[1 + a]]/(2*Sqrt[1 + a])) - ArcTanh[x/Sqrt[1 - a]]/(2*Sqrt[1 - a])}
(* Tests that NegativeQ[b^2-4*a*c] returns True to avoid I in antiderivative! *)
{1/(1 + a^2 + 2*a*x^2 + x^4), x, 9, -(ArcTan[(Sqrt[-a + Sqrt[1 + a^2]] - Sqrt[2]*x)/Sqrt[a + Sqrt[1 + a^2]]]/(2*Sqrt[2]*Sqrt[1 + a^2]*Sqrt[a + Sqrt[1 + a^2]])) + ArcTan[(Sqrt[-a + Sqrt[1 + a^2]] + Sqrt[2]*x)/Sqrt[a + Sqrt[1 + a^2]]]/(2*Sqrt[2]*Sqrt[1 + a^2]*Sqrt[a + Sqrt[1 + a^2]]) - Log[Sqrt[1 + a^2] - Sqrt[2]*Sqrt[-a + Sqrt[1 + a^2]]*x + x^2]/(4*Sqrt[2]*Sqrt[1 + a^2]*Sqrt[-a + Sqrt[1 + a^2]]) + Log[Sqrt[1 + a^2] + Sqrt[2]*Sqrt[-a + Sqrt[1 + a^2]]*x + x^2]/(4*Sqrt[2]*Sqrt[1 + a^2]*Sqrt[-a + Sqrt[1 + a^2]])}

{1/(4 - 5*x^2 + x^4), x, 3, (-(1/6))*ArcTanh[x/2] + ArcTanh[x]/3}
{1/(3 + 4*x^2 + x^4), x, 3, ArcTan[x]/2 - ArcTan[x/Sqrt[3]]/(2*Sqrt[3])}
{1/(9 + 5*x^2 + x^4), x, 9, -(ArcTan[(1 - 2*x)/Sqrt[11]]/(6*Sqrt[11])) + ArcTan[(1 + 2*x)/Sqrt[11]]/(6*Sqrt[11]) - (1/12)*Log[3 - x + x^2] + (1/12)*Log[3 + x + x^2]}
{1/(1 - x^2 + x^4), x, 9, (-(1/2))*ArcTan[Sqrt[3] - 2*x] + (1/2)*ArcTan[Sqrt[3] + 2*x] - Log[1 - Sqrt[3]*x + x^2]/(4*Sqrt[3]) + Log[1 + Sqrt[3]*x + x^2]/(4*Sqrt[3])}
{1/(2 + 2*x^2 + x^4), x, 9, (-(1/4))*Sqrt[-1 + Sqrt[2]]*ArcTan[(Sqrt[2*(-1 + Sqrt[2])] - 2*x)/Sqrt[2*(1 + Sqrt[2])]] + (1/4)*Sqrt[-1 + Sqrt[2]]*ArcTan[(Sqrt[2*(-1 + Sqrt[2])] + 2*x)/Sqrt[2*(1 + Sqrt[2])]] - Log[Sqrt[2] - Sqrt[2*(-1 + Sqrt[2])]*x + x^2]/(8*Sqrt[-1 + Sqrt[2]]) + Log[Sqrt[2] + Sqrt[2*(-1 + Sqrt[2])]*x + x^2]/(8*Sqrt[-1 + Sqrt[2]])}


